import React, { Component } from 'react';
import styled from 'styled-components';

const Container= styled.div`
  background: rgba(7, 240, 162, .9);
  display: flex;
`

class Header extends Component {
  render() {
    return (
      <Container>
        <h2>
          Eliseo Flores
        </h2>
      </Container>
    )
  }
}
